INSERT INTO `about` (`id`, `en_title`, `en_text`, `hi_title`, `hi_text`) VALUES
(1, 'About Motwani Matrimonial', 'Motwani Matrimonial is matrimonial website for finding a perfect life partner in trimes samaaj in any age category. \r\n<br><br>\r\n Motwani Matrimonial understands the importance of choosing the right partner for marriage, especially in the Indian cultural setup. It believes in providing the most secure and convenient matchmaking experience to all its members by ensuring 100% screening, exclusive privacy options, photo protection features and verification of phone numbers and more information.\r\n<br><br>\r\n\r\nWe know it is very difficult to search many profile and select any person by only picture and details, We helps you in this with only verified profile with correct details. ', 'About Motwani Matrimonial', 'मोटवानी मैट्रिमोनियल किसी भी आयु वर्ग में मोटवानी समाज में एक आदर्श जीवनसाथी खोजने के लिए वैवाहिक वेबसाइट है।\r\n<br> <br>\r\nमोटवानी मैट्रिमोनियल शादी के लिए सही साथी चुनने के महत्व को समझता है, खासकर भारतीय सांस्कृतिक सेटअप में। यह अपने सभी सदस्यों को 100% स्क्रीनिंग, अनन्य गोपनीयता विकल्प, फोटो सुरक्षा सुविधाओं और फोन नंबरों के सत्यापन और अधिक जानकारी सुनिश्चित करके सबसे सुरक्षित और सुविधाजनक मैचमेकिंग अनुभव प्रदान करता है।\r\n<br> <br>\r\n\r\nहम जानते हैं कि बहुत से प्रोफ़ाइल खोजना और किसी भी व्यक्ति को केवल चित्र और विवरण द्वारा चुनना बहुत मुश्किल है, हम आपको केवल सही विवरण के साथ सत्यापित प्रोफ़ाइल के साथ इसमें मदद करते हैं।');
